import './Array.css';
import Col from 'react-bootstrap/Col'

const arrays = [
    {
        id: 1,
        image: 'https://static.nike.com/a/images/t_PDP_1728_v1/f_auto,q_auto:eco/758c805c-dde5-4df5-9780-56196bcc238a/air-jordan-1-retro-high-og-womens-shoes-LcJVSj.png',
        title: 'Hello world',
        text: 'Lorem ipsum dolor'
    },
    {
        id: 2,
        image: 'https://static.nike.com/a/images/t_PDP_1728_v1/f_auto,q_auto:eco/807cc697-edc5-4bec-9207-7515864fcb46/air-jordan-1-retro-high-og-womens-shoes-LcJVSj.png',
        title: 'Hello world',
        text: 'Lorem ipsum dolor'
    },
    {
        id: 3,
        title: 'Why Do You Use That',
        text: 'Lorem ipsum'
    }
];

const ArrayList = arrays.map(
    (array) => 
    <div key = {array.id}>
        <Col sm = {12} md = {6} lg = {4}>
            <div className='block-image'>
                <img src = {array.image} />
            </div>
                
            <div className='block-content'>
                <div className="block-title">
                    <h1>{array.title}</h1>
                </div>
                
                <div className="block-text">
                    <p>{array.text}</p>
                </div>
            </div> 
        </Col>
    </div>
);

function Array(){
    return(
        <Col sm = {12} md = {6} lg = {4}>
        {ArrayList}
        </Col>
    );
}

export default Array
